import { Outlet, useNavigate } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";

function RootLayout() {
  const navigate = useNavigate();

  return <>
    <MainNavigation />
    <main>
      {navigate.state === 'loading' && <p>Loading...</p>}
      <Outlet />
    </main>
  </>
};

export default RootLayout;
